import React from "react";
import ReactDom from 'react-dom';
import Joke from "./Jokes.js";

const myarray = ["red","blue","green","yellow","black"]
const myarray2 = myarray.map(function(str)
{
  return (
    <h3>{str}</h3>
  )
})
const Jokes = () => 
{
  return (
    <>
      {myarray2}
    </>
  )
}






const Element = <>
  <Jokes/>
  console.log(Joke);
</>

const root = ReactDom.createRoot(document.getElementById('root'));
root.render(Element)
